var title_f40_21_41308="Characteristics estab RA";
var content_f40_21_41308=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F51732&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F51732&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Characteristics of arthritis in established rheumatoid arthritis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Characteristics",
"       </td>",
"       <td class=\"subtitle1\">",
"        Prominent in RA",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comparison to other forms of arthritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polyarticular involvement",
"       </td>",
"       <td>",
"        Usually polyarthritis (&ge;5 joints, often with compression tenderness of MCP and MTP joints",
"       </td>",
"       <td>",
"        Peripheral SpA&nbsp;usually with fewer involved joints (but RA can also be oligoarticular at onset)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronicity",
"       </td>",
"       <td>",
"        &ge;6 weeks",
"       </td>",
"       <td>",
"        Viral infectious causes of&nbsp;arthritis&nbsp;are frequently self-limited",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inflammation",
"       </td>",
"       <td>",
"        <p>",
"         Synovial joint swelling",
"        </p>",
"        <p>",
"         CRP, ESR elevation",
"        </p>",
"       </td>",
"       <td>",
"        OA has more bony swelling, and significantly lower CRP and ESR",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symmetry",
"       </td>",
"       <td>",
"        Same joint regions of contralateral extremities",
"       </td>",
"       <td>",
"        Peripheral SpA&nbsp;usually asymmetric",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Upper and lower extremity",
"       </td>",
"       <td>",
"        Small and/or large joints of both upper and lower extremities",
"       </td>",
"       <td>",
"        Peripheral SpA&nbsp;involve mostly lower extremity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Erosions",
"       </td>",
"       <td>",
"        Bony destruction seen on imaging",
"       </td>",
"       <td>",
"        Most other forms of arthritis are non-erosive; psoriatic arthritis&nbsp;characterized by&nbsp;both&nbsp;bony proliferative&nbsp;and adjacent destructive (erosive) processes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autoantibodies",
"       </td>",
"       <td>",
"        RF, anti-CCP, anti-RA33",
"       </td>",
"       <td>",
"        Most other diseases are \"seronegative\" for these markers (and may be associated with other types of autoantibodies)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recent infections or comorbid conditions associated with arthritides",
"       </td>",
"       <td>",
"        Usually absent&nbsp;",
"       </td>",
"       <td>",
"        Urinary or GI infections (reactive arthritis); psoriasis (psoriatic arthritis); IBD; ankylosing spondylitis; connective tissue diseases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Genetic markers",
"       </td>",
"       <td>",
"        Particular DR (shared epitope) types",
"       </td>",
"       <td>",
"        Differing genetic markers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Morning stiffness",
"       </td>",
"       <td>",
"        Typically 60 min or more",
"       </td>",
"       <td>",
"        In OA and other inflammatory arthritides stiffness is less frequent and shorter duration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inflammatory disease affecting spine",
"       </td>",
"       <td>",
"        &nbsp;Cervical spine, frequently in atlantoaxial region",
"       </td>",
"       <td>",
"        In SpA, inflammatory&nbsp;abnormalities frequent in sacroiliac joints, bony proliferation&nbsp;at vertebral bodies with ossification of intervertebral ligaments is present; clinically manifests as \"inflammatory back pain\"",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     RA: rheumatoid arthritis; MCP: metacarpophalangeal; MTP: metatarsophalagneal; SpA: spondyloarthritis; CRP: C-reactive protein; ESR: erythrocyte sedimentation rate; OA: osteoarthritis; RF: rheumatoid factor; anti-CCP: anti-cyclic citrullinated peptide antibodies; DQ and DR: major histocompatibility class II antigens.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Josef Smolen, MD, Daniel Aletaha, MD, and Klaus Machold, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
